import React from "react";


class Results extends React.Component {
    render() {
        return this.props.notes.map(function (item, index) {
            return (
                <div key={index}>
                    <p className="news__idNote">{item.idNote}:</p>
                    <p className="news__text">{item.textNote}</p>
                </div>)
        });
    }

